INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 7001, -363.0, 1, 106001, 7, "2015/12/17 15:00:00", 0, "キャル", 0.0, "2030/12/17 14:59:59", 0, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 7002, -363.0, 1, 105901, 7, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 7003, -363.0, 1, 105801, 7, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 10001, -363.0, 1, 105801, 10, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 10002, -363.0, 1, 106001, 10, "2015/12/17 15:00:00", 0, "キャル", 0.0, "2030/12/17 14:59:59", 0, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 10003, -363.0, 1, 105901, 10, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 10004, -363.0, 2, 106401, 10, "2015/12/17 15:00:00", 0, "シェフィ", 0.0, "2030/12/17 14:59:59", 2104010, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 12001, -416.5, 1, 105801, 12, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 13001, -363.0, 1, 106001, 13, "2015/12/17 15:00:00", 0, "キャル", 0.0, "2030/12/17 14:59:59", 0, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 13002, -363.0, 1, 105901, 13, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 13003, -363.0, 2, 106401, 13, "2015/12/17 15:00:00", 0, "シェフィ", 0.0, "2030/12/17 14:59:59", 2104010, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 13004, -363.0, 1, 105801, 13, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 14001, -363.0, 1, 105901, 14, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 14002, -363.0, 2, 106401, 14, "2015/12/17 15:00:00", 0, "シェフィ", 0.0, "2030/12/17 14:59:59", 2104010, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 14003, -363.0, 1, 105801, 14, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 14004, -363.0, 1, 106001, 14, "2015/12/17 15:00:00", 0, "キャル", 0.0, "2030/12/17 14:59:59", 0, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 15001, -470.0, 1, 105901, 15, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 16001, -363.0, 2, 106401, 16, "2015/12/17 15:00:00", 0, "シェフィ", 0.0, "2030/12/17 14:59:59", 2104010, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 16002, -363.0, 1, 105801, 16, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 16003, -363.0, 1, 106001, 16, "2015/12/17 15:00:00", 0, "キャル", 0.0, "2030/12/17 14:59:59", 0, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 16004, -363.0, 1, 105901, 16, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 17002, -363.0, 1, 105901, 17, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 17004, -363.0, 1, 106001, 25, "2015/12/17 15:00:00", 0, "キャル", 0.0, "2030/12/17 14:59:59", 0, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 17005, -363.0, 1, 105901, 25, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 17006, -363.0, 2, 106401, 25, "2015/12/17 15:00:00", 0, "シェフィ", 0.0, "2030/12/17 14:59:59", 2104010, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 17007, -363.0, 1, 105801, 25, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 18001, -363.0, 1, 190801, 18, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2, 0.0, 18002, -363.0, 1, 190801, 18, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (3, 0.0, 19001, -470.0, 1, 190801, 19, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4, 0.0, 19002, -470.0, 1, 190801, 19, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (5, 0.0, 20001, -470.0, 1, 190801, 20, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (6, 0.0, 20002, -470.0, 1, 190801, 20, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 21001, -363.0, 1, 106001, 21, "2015/12/17 15:00:00", 0, "キャル", 0.0, "2030/12/17 14:59:59", 0, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 21002, -363.0, 1, 105901, 21, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 21003, -363.0, 2, 106401, 21, "2015/12/17 15:00:00", 0, "シェフィ", 0.0, "2030/12/17 14:59:59", 2104010, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 21004, -363.0, 1, 105801, 21, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 22001, -430.0, 1, 190801, 22, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2, 0.0, 22002, -430.0, 1, 190801, 22, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (3, 0.0, 23001, -430.0, 1, 190801, 23, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4, 0.0, 23002, -430.0, 1, 190801, 23, "2015/12/17 15:00:00", 0, "カリン", 0.0, "2030/12/17 14:59:59", 0, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 8.0, 24001, -385.0, 1, 109001, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 4.08, "2030/12/17 14:59:59", 0, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2, 8.0, 24002, -385.0, 1, 109001, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 5.0, "2030/12/17 14:59:59", 0, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (3, 8.0, 24003, -385.0, 1, 109001, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 10.11, "2030/12/17 14:59:59", 0, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4, 8.0, 24004, -385.0, 1, 109001, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 4.0, "2030/12/17 14:59:59", 0, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (5, 8.0, 24005, -385.0, 1, 109001, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 6.0, "2030/12/17 14:59:59", 0, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (6, 0.0, 24006, 0.0, 1, 109002, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (7, 0.0, 24007, 0.0, 1, 109002, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (8, 0.0, 24008, 0.0, 1, 109002, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (9, 0.0, 24009, 0.0, 1, 109002, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10, 0.0, 24010, 0.0, 1, 109002, 24, "2019/01/31 12:00:00", 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 8.0, 24011, -385.0, 1, 109101, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 2.12, "2030/12/17 14:59:59", 0, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2, 8.0, 24012, -385.0, 5, 109101, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 4.19, "2030/12/17 14:59:59", 0, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (3, 8.0, 24013, -385.0, 2, 109101, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 2.3, "2030/12/17 14:59:59", 0, 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4, 0.0, 24014, 0.0, 1, 109102, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (5, 8.0, 24015, -385.0, 5, 109101, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 5.23, "2030/12/17 14:59:59", 0, 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (6, 0.0, 24016, 0.0, 1, 109102, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (7, 8.0, 24017, -385.0, 1, 109101, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 5.01, "2030/12/17 14:59:59", 0, 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (8, 0.0, 24018, 0.0, 1, 109102, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (9, 0.0, 24019, 0.0, 1, 109102, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10, 0.0, 24020, 0.0, 1, 109102, 24, "2019/01/31 12:00:00", 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", 0, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 26001, -363.0, 2, 106401, 26, "2015/12/17 15:00:00", 0, "シェフィ", 0.0, "2030/12/17 14:59:59", 2104010, 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 26002, -363.0, 1, 105801, 26, "2015/12/17 15:00:00", 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", 0, 1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 26003, -363.0, 1, 106001, 26, "2015/12/17 15:00:00", 0, "キャル", 0.0, "2030/12/17 14:59:59", 0, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 26004, -363.0, 1, 105901, 26, "2015/12/17 15:00:00", 0, "コッコロ", 0.0, "2030/12/17 14:59:59", 0, 1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (1, 0.0, 27001, -363.0, 2, 106401, 27, "2015/12/17 15:00:00", 0, "シェフィ", 0.0, "2030/12/17 14:59:59", 2104010, 1, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
